import React from 'react';
import PatientCard from './PatientCard';
import '../css/'; // Assuming you have a CSS file for styling

const Dashboard = ({ patients, setPatients }) => {
  const addNewPatient = () => {
    // Mock function - implement actual add patient functionality
    const newPatient = {
      id: patients.length + 1,
      name: "New Patient",
      age: 75,
      condition: "Assessment Pending",
      lastCheckup: new Date().toISOString().split('T')[0],
      emergencyContact: "Contact TBD",
      medications: [],
      activities: []
    };
    
    setPatients([...patients, newPatient]);
  };

  return (
    <div className="dashboard">
      <button className="add-patient-btn" onClick={addNewPatient}>
        + Add New Patient
      </button>
      
      <div className="patients-grid">
        {patients.map(patient => (
          <PatientCard key={patient.id} patient={patient} />
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
